/**
 * File: ShelfDetail.js
 * Mô tả: Component hiển thị chi tiết thông tin một kệ hàng trong dashboard quản lý kho.
 * Chức năng: 
 * - Hiển thị thông tin chi tiết của kệ hàng được chọn (tầng, khay, trạng thái)
 * - Hiển thị số lượng hiện tại, sức chứa và phần trăm đã sử dụng
 * - Hiển thị thời gian cập nhật thông tin gần nhất
 * - Cung cấp nút đóng để quay lại giao diện tổng quan
 * - Hỗ trợ accessibility với ARIA attributes
 */
import React, { useMemo } from 'react';
import './ShelfDetail.css';

const ShelfDetail = ({ shelf, onClose }) => {
    // Không hiển thị nếu không có dữ liệu
    if (!shelf) return null;

    // Tính toán phần trăm đã sử dụng
    const percentageFilled = useMemo(() => {
        const itemCount = shelf.itemCount || 0;
        const capacity = shelf.capacity || 1; // Tránh chia cho 0
        return (itemCount / capacity) * 100;
    }, [shelf.itemCount, shelf.capacity]);
    
    // Chuyển đổi trạng thái sang định dạng hiển thị dễ đọc
    const formatStatus = (status) => {
        if (!status) return '';
        const statusMap = {
            'HIGH': 'Đầy',
            'MEDIUM': 'Còn trống một phần',
            'EMPTY': 'Trống'
        };
        return statusMap[status] || status;
    };

    // Định dạng thời gian
    const formatDateTime = (dateString) => {
        if (!dateString) return '';
        try {
            const date = new Date(dateString);
            if (isNaN(date.getTime())) return '';
            
            return new Intl.DateTimeFormat('vi-VN', {
                year: 'numeric',
                month: 'numeric',
                day: 'numeric',
                hour: 'numeric',
                minute: 'numeric',
                second: 'numeric',
                hour12: false
            }).format(date);
        } catch (error) {
            console.error('Lỗi khi định dạng ngày:', error);
            return '';
        }
    };

    // Đảm bảo tier là số nguyên
    const displayTier = typeof shelf.tier === 'string' ? parseInt(shelf.tier, 10) : shelf.tier;

    return (
        <div className="shelf-detail" role="dialog" aria-labelledby="shelf-detail-title">
            <div className="shelf-detail-header">
                <h3 id="shelf-detail-title">Chi tiết kệ hàng</h3>
                <button 
                    onClick={onClose} 
                    className="close-button"
                    aria-label="Đóng chi tiết"
                >&times;</button>
            </div>
            <div className="shelf-detail-content">
                <div className="detail-row">
                    <span className="label">Tầng:</span>
                    <span className="value">{displayTier}</span>
                </div>
                <div className="detail-row">
                    <span className="label">Khay:</span>
                    <span className="value">{shelf.tray}</span>
                </div>
                <div className="detail-row">
                    <span className="label">Số lượng:</span>
                    <span className="value">
                        {shelf.itemCount || 0} / {shelf.capacity || 0} ({percentageFilled.toFixed(1)}%)
                    </span>
                </div>
                <div className="detail-row">
                    <span className="label">Trạng thái:</span>
                    <span className={`value status-${(shelf.status || '').toLowerCase()}`}>
                        {formatStatus(shelf.status)}
                    </span>
                </div>
                {shelf.lastUpdated && (
                    <div className="detail-row">
                        <span className="label">Cập nhật lần cuối:</span>
                        <span className="value">{formatDateTime(shelf.lastUpdated)}</span>
                    </div>
                )}
                {shelf.capacity !== undefined && (
                    <div className="detail-row">
                        <span className="label">Sức chứa:</span>
                        <span className="value">{shelf.capacity}</span>
                    </div>
                )}
            </div>
        </div>
    );
};

export default ShelfDetail;
